import React from 'react';
import {Route, Switch} from 'react-router-dom';
import './App.css';
import {Container} from 'semantic-ui-react';
import NavBar from './NavBar/Navbar';
import Login from './NavBar/LoginInSignUp/Login';
import SignUp from './NavBar/LoginInSignUp/SignUp';
import CategoriesDisplay from './Categories/CategoriesDisplay';
function App() {
  var firebaseConfig = {
    apiKey: "AIzaSyAKoqh8yVc0k5CsSIpHLbmbRWq-xYuxY5k",
    authDomain: "sample-d20d3.firebaseapp.com",
    databaseURL: "https://sample-d20d3.firebaseio.com",
    projectId: "sample-d20d3",
    storageBucket: "",
    messagingSenderId: "237234278769",
    appId: "1:237234278769:web:c79ba21355017baa"
  };
  return (
    <div>
       <NavBar /> 
      <Switch>
        <Route exact path = '/'  component={CategoriesDisplay}/>
      </Switch>
      <Route path = "/(.+)" render = {() => (
          <div className = "App">
           {/* <NavBar />  */}
            <Container className = "main">
              <Switch>
                <Route path = '/signup' component={SignUp}/>
                <Route path = '/login' component={Login}/>
              </Switch>
            </Container>
      </div> 
        )}/>
    </div>
  );
}

export default App;
